values:
I tore one of my rotor cuff muscles. It hurts. Will be another week untill its better.&nbsp;
I was instructor at karate tonight. I taught "Jodan ni" Kata. I need to get a new Gi considering i'm training 4 times per week. And what makes things worse is i have to get 2 more mouth guards and a couple pairs of foot armor. I predict i will be ninja'ing my weeks food from the neighbors again. Each week i do this the danger grows. Last week i almost fell into a punji pit while stealing a cheesecake.
Despite being injured and aparently utter batshit in the head things are going really good. I fully beat my step mum in a game of Monopoly, and last nights game of scrable kicked ass. Whats better is that i won and held the lead the whole way by around 100 points.&nbsp;
I am covered in bruises. Oh yeh! pain baby!

I am at an internet cafe thing. I do belive home internets will be working tomorrow.&nbsp;
I finished my course thing. Head of the class aparently. About to start new trade as a Boilermaker. Last time i was working in this industry i was pulling $1375 a week. But i know people pulling over $1500 a week. But i will be happy earning $10 a week as long as im doing something new.&nbsp;
I have been training myself and another person at gym. I have 2 more people to train from today onwards. I might be training with this last years Australian #1 pro over 50 bodybuilder a bit this year. I myself will be competing in May as an amature.
The whole excersise thing is going really good. About 2 hours each session 6 days a week sometimes 7 days, often 2 times a week.&nbsp;
Karate is getting busy again which means 4 times a week and 1 or 2 privet lessons. Karate is pretty cool, and i actually taught my sempai something the other night.&nbsp;
I have a couple more cars since i last updated. An old COlt hatchback to zip around in and a 2003 AU falcon, which i find myself driving more often than the colt.

Would someone like to make a logo for me? I would pay for it offcourse as long as i like it.&nbsp; 

I went outside for some delusion of "having fun in the sun". With my bow and arrows. I broke 2 arrows :(&nbsp; I proped an old car front seat up and fired at it down my drive way. The arrows went right through it. And into the brick wall. On this scale it would be cheaper to use bullets.&nbsp; 

I feel all hot an bothered now. Damn long weekends. Halting the arrival of my laptop in the mail. Aparently its only a fedral offence to fuck with mail unless its not the government doing it. What is this the 4th reich? Next we will go back to using pencils so all documents canbe altered.
